#!/usr/bin/env python3
import rclpy
from rclpy.node import Node class MyCustomNode(Node): # MODIFY NAME def __init__(self): super().__init__("node_name") # MODIFY NAME def main(args=None): rclpy.init(args=args) node = MyCustomNode() # MODIFY NAME rclpy.spin(node) rclpy.shutdown() if __name__ == "__main__": main() This is the basic templete refer this whenever needed.

